import './App.css';
import BabyNamesData from './babyNamesData.json'
console.log(BabyNamesData)
function App() {
  return (
    <div>
      <BabyNames names = {BabyNamesData}/> 
    </div>
  );
}
function BabyNames(props) {
props.names.map(babyName=> (<BabyName name={babyName}/>))
}
function BabyName(props) {
  return (<div>
    {props.name}
  </div>
  )
}
export default App;
